import { Navbar } from 'react-bootstrap';
import styles from './Navbar.module.scss';

const Nav = () => {
  return (
    <div className={styles.nav}>
      <div className="container">
        <div className="row">
          <ul>
            <li>Logo</li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default Nav;
